import React, { useState } from 'react';
import './NewLift.scss';

const NewLift = props => {
  const [selectedLift, setSelectedLift] = useState('SQUAT');
  const liftList = ['SQUAT', 'BENCH PRESS', 'DEADLIFT'];
  return (
    <div id="new-lift">
      <form id="lift-list">
        {liftList.map(lift => {
          return (
            <label>
              {lift}
              <input
                type="radio"
                value={lift}
                checked={lift === selectedLift}
                onChange={() => setSelectedLift(lift)}
              />
            </label>
          );
        })}
            <input type="submit" value="ADD LIFT" />
            <input type="button" value="CANCEL" />
      </form>
      <button type="button" onClick={props.toggleModal} className="button-one">
        CANCEL
      </button>
    </div>
  );
};

export default NewLift;
